function App() {
  return (
    <div>
      <header>
       <Header></Header>
      </header>
      <main>
      <Route  path='/welcome'> 
      <Welcome/>
   </Route>
   <Route path='/products'>
     <Product/>
   </Route>
   <Route path='/productdetails/:productid'>
   <ProductDetail/>
   </Route>
      </main>

    </div>
  );
}

export default App;
